import React, { Component } from 'react';
import {
    OwpPageCarded,
    Owp
} from 'owp/wrapper';
import { isUndefined, isEmpty } from 'lodash';
import Icon from '@material-ui/core/Icon';
import owpNavigationConfig from '@_configs/owpNavigationConfig';
import i18n from '@_configs/i18n';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {
            open: false,
            collapseID: '',
        };
    }
    getMenu = () => {
        return owpNavigationConfig(i18n.language)
            .filter(menuGroup => menuGroup.children).sort((a, b) => b.order - a.order)
            .map(({ id, title, type, icon, children }) => {
                let rederedFirstLevelChildMenu = children.map(({ id, title, type, url, children }) => {
                    if (isUndefined(children)) {
                        return (
                            <li className="list-group-item" key={id}>
                                <a href={url}>
                                    <Icon style={{ lineHeight: 'inherit' }}>arrow_right</Icon>
                                    <span className="font-dark">{title}</span>
                                </a>
                            </li>
                        );
                    } else {
                        let rederedSecondLevelChildMenu = children.map(({ id, title, type, url }) => {
                            return (
                                <li className="list-group-item" style={{ border: 'none' }} key={id}>
                                    <a href={url}>
                                        <Icon style={{ lineHeight: 'inherit' }}>arrow_right</Icon>
                                        <span className="font-dark">{title}</span>
                                    </a>
                                </li>
                            );
                        });
                        return (
                            <li className="list-group-item" key={id}>
                                <a href={void (0)}
                                    onClick={function () {
                                        if (isEmpty(this.state.collapseID) || this.state.collapseID == id) {
                                            this.setState({
                                                open: !this.state.open,
                                                collapseID: id,
                                            });
                                        } else {
                                            this.setState({
                                                open: true,
                                                collapseID: id,
                                            });
                                        }

                                    }.bind(this)}
                                >
                                    <Icon style={{ lineHeight: '1.5' }}>{this.state.open && this.state.collapseID == id ? "arrow_drop_down" : "arrow_right"}</Icon>
                                    <span className={this.state.open ? "font-dark bold" : "font-dark"}>{title}</span>
                                </a>
                                <div className={this.state.open && this.state.collapseID == id ? "panel-collapse" : "panel-collapse panel-close"}>
                                    <div className="portlet-body">
                                        <ul className="list-group">
                                            {rederedSecondLevelChildMenu}
                                        </ul>
                                    </div>
                                </div>
                            </li>
                        );
                    }
                });

                return (
                    <div className="col-lg-3" key={id}>
                        <div className="portlet light bordered">
                            <div className="portlet-title">
                                <div className="caption">
                                    <span className="font-dark bold">{title}</span>
                                </div>
                                <div className="actions">
                                    <Icon className="ico_m01 c04">home</Icon>
                                </div>
                            </div>
                            <div className="portlet-body">
                                <ul className="list-group">
                                    {rederedFirstLevelChildMenu}
                                </ul>
                            </div>
                        </div>
                    </div>
                );
            });
    };
    render() {
        let renderedMenu = this.getMenu();
        return (
            <React.Fragment>
                <OwpPageCarded
                    content={
                        <div>
                            <div className="pt-16">
                                <div>
                                    {renderedMenu}
                                </div>
                            </div>
                        </div>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
